import React from 'react'
import { useHistory } from 'react-router-dom'


function NavBar() {
    let history= useHistory()
    return (
       
        <div>
            <button onClick={()=>history.push("./addflight")}>AddFlight</button>
            <button onClick={()=>history.push("./viewFlight")}>viewFlights</button>

            
        </div>
    )
}

export default NavBar
